import React from 'react';
import Popup from "reactjs-popup";

const  SchedulerEvent = ({startHourBytes,eventDuration, columID,comments,startHour,endHour})=>
{
  let leftPlace=50+columID*140; 
  return(
        <div style={{top:startHourBytes,left:leftPlace, position:"absolute", height:eventDuration,width:"140px",backgroundColor:"Yellow", border:"solid"}} >
          <Popup trigger={<div> ...</div>} position="right center">
            <div>
              <div>{startHour}-{endHour}</div>
              <div>{comments}</div>
            </div>
          </Popup>
          <div  style={{textAlign:"right"}}>משימה</div>
          </div>
  );
}
export default SchedulerEvent
